def build_master_problem(B):
    master = LpProblem("Maestro", LpMinimize)
    y = {k: LpVariable(f"y_{k}", lowBound=0) for k in B}

    # Funcin objetivo: minimizar el nmero de quirofanos usados
    master += lpSum(y[k] for k in B)

    # Restricciones de demanda
    for i in I:
        master += lpSum(B[k][i] * y[k] for k in B) >=1, f"Demand_{i}"

    return master, y

# Construir el modelo maestro inicial
master_problem, xi = build_master_problem(B)

# Resolver el modelo maestro inicial (relajacin)
master_problem.solve()
# Resultados iniciales
print("Resultados iniciales del modelo maestro (relajado):")
print(f"Valor objetivo inicial (planes usados): {value(master_problem.objective)}")
print(f"Estado (optimizador): {LpStatus[master_problem.status]}")
print

# Subproblema para generar nuevos patrones
max_iterations = 100  # Lmite mximo de iteraciones
iteration = 0

while iteration < max_iterations:
    iteration += 1
    # Obtener los costos duales de las restricciones de demanda
    duals = {i: master_problem.constraints[f"Demand_{i}"].pi for i in I}
    # Subproblema: maximizar la reduccin del costo dual (Problema de la Mochila)
    subproblem = LpProblem("Auxiliar", LpMaximize)
    # Variables de decisin del subproblema
    x = {i: LpVariable(f"x_{i}", lowBound=0, upBound=1, cat=LpBinary) for i in I}
    # Funcin objetivo del subproblema
    subproblem += lpSum(duals[i] * x[i] for i in I) 
    # Restricciones de Formacion de planificacions
    for i in I:
        if len(L[i])>0:
            subproblem += lpSum(x[h] for h in L[i]) <= len(L[i])*(1-x[i]), f"Operacion_{i}"
    # Resolver el subproblema
    subproblem.solve()
    #print(f"Valor objetivo Auxiliar iteracin {iteration}: {value(subproblem.objective)}")
    #print(f"Estado (optimizador): {LpStatus[subproblem.status]}")
    #print()
    # Verificar si el subproblema gener un patrn vlido
    if subproblem.status != 1 or value(subproblem.objective) is None or value(subproblem.objective) <= 1e-6:
        print("No se pueden generar ms patrones.")
        break
    #for i in I:
