    # Nueva planificacion generada
    new_pattern = {i: 0 if (x[i].varValue) is None else (x[i].varValue)  for i in I}
    #new_pattern = [0 if x is None else x for x in new_pattern]
    # Verificar si la planificacion ya existe
    if new_pattern in B.values():
        print("Planificacion duplicada detectada Terminando.")
        break
    
    # Agregar el nuevo patrn
    new_index = str(len(B) + 1)
    B[new_index] = new_pattern
    #print(f"Nuevo planificacioin generado en iteracin {iteration}: {new_pattern}")
    # Reconstruir el modelo maestro
    master_problem, xi = build_master_problem(B)
    
    # Resolver nuevamente el modelo maestro (relajado)
    master_problem.solve(PULP_CBC_CMD())
    print(f"Valor objetivo iteracin {iteration} (planes usados): {value(master_problem.objective)}")
